import React from 'react'

function Chat() {
  return (
    <div className='chat'>
        <div className='chat__convo'>
            <img src='https://static.wikia.nocookie.net/dojacat/images/b/b3/Doja_Cat_in_August_2020.jpg/revision/latest?cb=20200820200441' width='50px' height='50px' />
        </div>
    </div>
  )
}

export default Chat
